class Solution:
    def maxOperations(self, s: str) -> int:
        ops=0
        got=True
        mobile=0
        jumping=False
        hit=False
        for i,val in enumerate(s):
            if val=="1":
                if jumping:
                    ops+=mobile
                mobile+=1
                jumping=False
                hit=True
            else:
                if hit:
                    jumping=True
        if jumping==True:
            ops+=mobile
        return ops
